import React, { useState, useEffect } from "react";
import TreeView from "@mui/lab/TreeView";
import { styled } from "@mui/material/styles";
import ExpandMoreIcon from "@mui/icons-material/ExpandMore";
import ChevronRightIcon from "@mui/icons-material/ChevronRight";
import TreeItem, { treeItemClasses } from "@mui/lab/TreeItem";
import { Grid, Typography, Box, TextField, IconButton } from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";
import axios from "axios";

const StyledTreeItem = styled(TreeItem)(({ rootNode }) => {
  const borderColor = "gray";

  return {
    position: "relative",
    "&:before": {
      pointerEvents: "none",
      content: '""',
      position: "absolute",
      width: 32,
      left: -16,
      top: 12,
      borderBottom: !rootNode ? `1px dashed ${borderColor}` : "none"
    },
    [`& .${treeItemClasses.group}`]: {
      marginLeft: 16,
      paddingLeft: 18,
      borderLeft: `1px dashed ${borderColor}`
    }
  };
});

const StyledBox = styled(Box)({
  width: "90%",
  fontSize: "1.2em",
  margin: "20px auto",
  textAlign: "center",
  "& p": {
    textAlign: "justify",
    color: "#000000",
    fontFamily: "Helvetica Neue",
    margin: "20px 10px"
  },
  maxWidth: "250px",
  color: "#000000" // Cambia el color del texto a negro
});

const StyledTreeView = styled(TreeView)({
  "& .MuiTreeItem-content": {
    color: "#000000", // Cambiar el color del texto cuando el árbol se despliega
  },
});

// Estilo personalizado para el indicador de despliegue
const Indicator = styled.span({
  display: "inline-block",
  width: 8,
  height: 8,
  borderRadius: "50%",
  backgroundColor: "green",
  marginRight: 4,
});

export default function FileSystemNavigator() {
  const [reinos, setReinos] = useState([]);
  const [filos, setFilos] = useState([]);
  const [clases, setClases] = useState([]);
  const [ordenes, setOrdenes] = useState([]);
  const [familias, setFamilias] = useState([]);
  const [generos, setGeneros] = useState([]);
  const [especies, setEspecies] = useState([]);
  const [searchText, setSearchText] = useState("");

  useEffect(() => {
    // Obtener los reinos al cargar el componente
    fetchReinos();
  }, []);

  const fetchReinos = async () => {
    try {
      const response = await axios.get("http://localhost:4000/reinos");
      setReinos(response.data);
    } catch (error) {
      console.error("Error fetching reinos data: ", error);
    }
  };

  const fetchFilos = async (reinoId) => {
    try {
      const response = await axios.get(`http://localhost:4000/filos/${reinoId}`);
      setFilos(response.data);
    } catch (error) {
      console.error("Error fetching filos data: ", error);
    }
  };

  const fetchClases = async (filoId) => {
    try {
      const response = await axios.get(`http://localhost:4000/clases/${filoId}`);
      setClases(response.data);
    } catch (error) {
      console.error("Error fetching clases data: ", error);
    }
  };

  const fetchOrdenes = async (claseId) => {
    try {
      const response = await axios.get(`http://localhost:4000/ordenes/${claseId}`);
      setOrdenes(response.data);
    } catch (error) {
      console.error("Error fetching ordenes data: ", error);
    }
  };

  const fetchFamilias = async (ordenId) => {
    try {
      const response = await axios.get(`http://localhost:4000/familias/${ordenId}`);
      setFamilias(response.data);
    } catch (error) {
      console.error("Error fetching familias data: ", error);
    }
  };

  const fetchGeneros = async (familiaId) => {
    try {
      const response = await axios.get(`http://localhost:4000/generos/${familiaId}`);
      setGeneros(response.data);
    } catch (error) {
      console.error("Error fetching generos data: ", error);
    }
  };

  const fetchEspecies = async (generoId) => {
    try {
      const response = await axios.get(`http://localhost:4000/especies/${generoId}`);
      setEspecies(response.data);
    } catch (error) {
      console.error("Error fetching especies data: ", error);
    }
  };

  const handleReinoClick = (event, nodeId) => {
    if (nodeId) {
      const reinoId = nodeId.split("-")[1];
      const reino = reinos.find((reino) => reino.rei_id.toString() === reinoId);
      if (reino) {
        fetchFilos(reinoId);
        setClases([]);
        setOrdenes([]);
        setFamilias([]);
        setGeneros([]);
        setEspecies([]);
      }
    }
  };

  const handleFiloClick = (event, nodeId) => {
    if (nodeId) {
      const filoId = nodeId.split("-")[1];
      const filo = filos.find((filo) => filo.fil_id.toString() === filoId);
      if (filo) {
        fetchClases(filoId);
        setOrdenes([]);
        setFamilias([]);
        setGeneros([]);
        setEspecies([]);
      }
    }
  };

  const handleClaseClick = (event, nodeId) => {
    if (nodeId) {
      const claseId = nodeId.split("-")[1];
      const clase = clases.find((clase) => clase.cla_id.toString() === claseId);
      if (clase) {
        fetchOrdenes(claseId);
        setFamilias([]);
        setGeneros([]);
        setEspecies([]);
      }
    }
  };

  const handleOrdenClick = (event, nodeId) => {
    if (nodeId) {
      const ordenId = nodeId.split("-")[1];
      const orden = ordenes.find((orden) => orden.ord_id.toString() === ordenId);
      if (orden) {
        fetchFamilias(ordenId);
        setGeneros([]);
        setEspecies([]);
      }
    }
  };

  const handleFamiliaClick = (event, nodeId) => {
    if (nodeId) {
      const familiaId = nodeId.split("-")[1];
      const familia = familias.find((familia) => familia.fam_id.toString() === familiaId);
      if (familia) {
        fetchGeneros(familiaId);
        setEspecies([]);
      }
    }
  };

  const handleGeneroClick = (event, nodeId) => {
    if (nodeId) {
      const generoId = nodeId.split("-")[1];
      const genero = generos.find((genero) => genero.gen_id.toString() === generoId);
      if (genero) {
        fetchEspecies(generoId);
      }
    }
  };

  const renderReinos = () => {
    return reinos.map((reino) => {
      const hasFilos = filos.some((filo) => filo.rei_id.toString() === reino.rei_id.toString());
      const label = (
        <>
          {hasFilos && <Indicator />} {/* Indicador de despliegue */}
          {reino.rei_nombre.trim()}
        </>
      );

      return (
        <StyledTreeItem
          key={reino.rei_id}
          nodeId={`reino-${reino.rei_id}`}
          label={label}
          onClick={(event) => handleReinoClick(event, `reino-${reino.rei_id}`)}
        />
      );
    });
  };

  const renderFilos = () => {
    return filos.map((filo) => {
      const hasClases = clases.some((clase) => clase.fil_id.toString() === filo.fil_id.toString());
      const label = (
        <>
          {hasClases && <Indicator />} {/* Indicador de despliegue */}
          {filo.fil_nombre.trim()}
        </>
      );

      return (
        <StyledTreeItem
          key={filo.fil_id}
          nodeId={`filo-${filo.fil_id}`}
          label={label}
          onClick={(event) => handleFiloClick(event, `filo-${filo.fil_id}`)}
        />
      );
    });
  };

  const renderClases = () => {
    return clases.map((clase) => {
      const hasOrdenes = ordenes.some((orden) => orden.cla_id.toString() === clase.cla_id.toString());
      const label = (
        <>
          {hasOrdenes && <Indicator />} {/* Indicador de despliegue */}
          {clase.cla_nombre.trim()}
        </>
      );

      return (
        <StyledTreeItem
          key={clase.cla_id}
          nodeId={`clase-${clase.cla_id}`}
          label={label}
          onClick={(event) => handleClaseClick(event, `clase-${clase.cla_id}`)}
        />
      );
    });
  };

  const renderOrdenes = () => {
    return ordenes.map((orden) => {
      const hasFamilias = familias.some((familia) => familia.ord_id.toString() === orden.ord_id.toString());
      const label = (
        <>
          {hasFamilias && <Indicator />} {/* Indicador de despliegue */}
          {orden.ord_nombre.trim()}
        </>
      );

      return (
        <StyledTreeItem
          key={orden.ord_id}
          nodeId={`orden-${orden.ord_id}`}
          label={label}
          onClick={(event) => handleOrdenClick(event, `orden-${orden.ord_id}`)}
        />
      );
    });
  };

  const renderFamilias = () => {
    return familias.map((familia) => {
      const hasGeneros = generos.some((genero) => genero.fam_id.toString() === familia.fam_id.toString());
      const label = (
        <>
          {hasGeneros && <Indicator />} {/* Indicador de despliegue */}
          {familia.fam_nombre.trim()}
        </>
      );

      return (
        <StyledTreeItem
          key={familia.fam_id}
          nodeId={`familia-${familia.fam_id}`}
          label={label}
          onClick={(event) => handleFamiliaClick(event, `familia-${familia.fam_id}`)}
        />
      );
    });
  };

  const renderGeneros = () => {
    return generos.map((genero) => {
      const hasEspecies = especies.some((especie) => especie.gen_id.toString() === genero.gen_id.toString());
      const label = (
        <>
          {hasEspecies && <Indicator />} {/* Indicador de despliegue */}
          {genero.gen_nombre.trim()}
        </>
      );

      return (
        <StyledTreeItem
          key={genero.gen_id}
          nodeId={`genero-${genero.gen_id}`}
          label={label}
          onClick={(event) => handleGeneroClick(event, `genero-${genero.gen_id}`)}
        />
      );
    });
  };

  const renderEspecies = () => {
    return especies.map((especie) => (
      <StyledTreeItem
        key={especie.esp_id}
        nodeId={`especie-${especie.esp_id}`}
        label={especie.esp_nombre.trim()}
      />
    ));
  };

  return (
    <Box>
      <Grid container spacing={2}>
        <Grid item xs={12}>
          {/* Contenedor del Árbol y Trabajo académico */}
          <Box
            border={1}
            borderColor="#333333"
            p={2}
            borderRadius={2}
            minHeight="100vh"
            display="flex"
            flexDirection="column"
          >
            <Grid container spacing={2}>
              <Grid item xs={2}>
                {/* Árbol filogenético */}
                <StyledTreeView
                  defaultCollapseIcon={<ExpandMoreIcon />}
                  defaultExpandIcon={<ChevronRightIcon />}
                  sx={{ height: 240, flexGrow: 1 }}
                >
                  {/* Resto del árbol */}
                  {renderReinos()}
                </StyledTreeView>
              </Grid>
              <Grid item xs={2}>
                {/* Filos */}
                {filos.length > 0 && (
                  <StyledTreeView
                    defaultCollapseIcon={<ExpandMoreIcon />}
                    defaultExpandIcon={<ChevronRightIcon />}
                  >
                    {renderFilos()}
                  </StyledTreeView>
                )}
              </Grid>
              <Grid item xs={2}>
                {/* Clases */}
                {clases.length > 0 && (
                  <StyledTreeView
                    defaultCollapseIcon={<ExpandMoreIcon />}
                    defaultExpandIcon={<ChevronRightIcon />}
                  >
                    {renderClases()}
                  </StyledTreeView>
                )}
              </Grid>
              <Grid item xs={2}>
                {/* Órdenes */}
                {ordenes.length > 0 && (
                  <StyledTreeView
                    defaultCollapseIcon={<ExpandMoreIcon />}
                    defaultExpandIcon={<ChevronRightIcon />}
                  >
                    {renderOrdenes()}
                  </StyledTreeView>
                )}
              </Grid>
              <Grid item xs={2}>
                {/* Familias */}
                {familias.length > 0 && (
                  <StyledTreeView
                    defaultCollapseIcon={<ExpandMoreIcon />}
                    defaultExpandIcon={<ChevronRightIcon />}
                  >
                    {renderFamilias()}
                  </StyledTreeView>
                )}
              </Grid>
              <Grid item xs={2}>
                {/* Géneros */}
                {generos.length > 0 && (
                  <StyledTreeView
                    defaultCollapseIcon={<ExpandMoreIcon />}
                    defaultExpandIcon={<ChevronRightIcon />}
                  >
                    {renderGeneros()}
                  </StyledTreeView>
                )}
              </Grid>
              <Grid item xs={2}>
                {/* Especies */}
                {especies.length > 0 && (
                  <StyledTreeView
                    defaultCollapseIcon={<ExpandMoreIcon />}
                    defaultExpandIcon={<ChevronRightIcon />}
                  >
                    {renderEspecies()}
                  </StyledTreeView>
                )}
              </Grid>
            </Grid>
          </Box>
        </Grid>
      </Grid>
    </Box>
  );
}
